    false,nt"url": null,nt"notes": "FY 2011 Digital Orthophotography (B089)
    North District One-Foot Orthophoto under Purchace Order # 11POSOW0171. Provide new
    high resolution 12" pixel four band stack RGBI digital orthophotos of approximately
    1722sq. miles in Hernando, Citrus, & Sumter Counties., Fl. This project is a cooperative
    effort with SWFWMD. New aerial digital photography will be taken with a Vexcel UltraCamX
    digital aerial sensor using 60% forward and 40% sidelap producing a 9inch raw pixel
    while covering 1920 5000ft. x 5000ft. SWFWMD cells. Flights are to begin Dec. 15th,
    2010 and be completed by Feb. 28th, 2010. Photography must be taken during 30degree
    sun angle and be free of smoke and clouds. Final project deliverables will be in
    NAD83 (2007). All work will be under the supervision of a licensed Florida Professional
    Surveyor and Mapper. Orthophotos will meet or exceed a verified horizontal accuracy
    of 5.26ft. at the 95% confidence interval (3.0 feet RMSE) as specified in the FGDC
    standards. Thirty independent check points will be surveyed and used to verify accuracy.
    No correction for building lean is required.",nt"owner_org": "b0b4c45b-a8ca-416b-b463-ee90d0a1a3df",nt"extras":
